import React, { useState } from "react";
import axios from "axios";
import "./header.css";

const AddStudent = ({goBack}) => {
  const [selectedFile, setSelectedFile] = useState();
  const [isFilePicked, setIsFilePicked] = useState(false);

  const changeHandler = (event) => {
    setSelectedFile(event.target.files[0]);
  };

  return (
    <React.Fragment>

      <div className="container" id="daterangepicker-container">
        <div className="row">
          <div className="col-lg-12">
          <h4 class="m-t-3">Add Student</h4>

          <form class="form-horizontal">
                <div class="form-group">
                    <label for="inputEmail3" class="col-sm-3 control-label">Name</label>
                    <div class="col-sm-9">
                        <input type="email" class="form-control" id="inputEmail3" />
                    </div>
                </div>
                <div class="form-group">
                    <label for="inputEmail3" class="col-sm-3 control-label">Andrew Id</label>
                    <div class="col-sm-9">
                        <input type="email" class="form-control" id="inputEmail3" />
                    </div>
                </div>
                <div class="form-group">
                    <label for="inputEmail3" class="col-sm-3 control-label">Photo</label>
                    <div class="col-sm-9">
                        <input type="file" class="form-control" id="inputEmail3" />
                    </div>
                </div>
                <button type="submit" className="btn btn-primary">Save</button>
              <button className="btn btn-danger" onClick={() => goBack()}>Back</button>
            </form>
          </div>
        </div>

      </div>
    </React.Fragment>
  );
}

export default AddStudent;
